import DetailText from "./../components/detailText/detailText";
import { useLocation } from "react-router-dom";
const Detail = (props) => {
  const location = useLocation();
  const id = location.state.id;
  console.log(id);
  return (
    <div>
      <DetailImgs />
      <DetailInfo />
      <DetailText />
      <DetailFooter />
    </div>
  );
};

export default Detail;
